import React from 'react'
import styled from 'styled-components';

const Check = styled.check`
  color: #676767;
  font-size: 12px;
  font-weight: 600;
`;

class Checkbox extends React.Component{
    render(){
        return(
        <div>
            <Check type="checkbox" placeholder="Wachtwoord"/>
        </div>
        )
    }
}

export default Checkbox;
